import React, { Component } from 'react';
import './Home.sass';
import { Grid, Paper } from '@material-ui/core';


class Home extends Component {
    style = {
        root: {
            flexGrow: 1,
        },
        paper: {
            textAlign: 'center',
        },
    };

    render() {
        return (
            <div className={'Home-container'}>
                <Grid container spacing={24}>
                    <Grid item xs={12}>
                        <Paper styles={style.paper}>
                            awsdasd
                        </Paper>
                    </Grid>
                </Grid>
            </div>
        );
    }
}
export default Home;
